import React from "react";
import { useState } from "react";
export default function App(){
  const [bgclr,setBgclr]=useState()
  document.body.style=`background-color:${bgclr} ;`
  return(
    <div >
      <button onClick={()=>setBgclr('red')}>red</button>
      <button onClick={()=>setBgclr('yellow')}>yellow</button>
      <button onClick={()=>setBgclr('blue')}>blue</button>
      <button onClick={()=>setBgclr('green')}>green</button>
    </div>
  )
}
